import React from 'react';
import './index.css'; 
import Deletebutton from "../button/Deletebutton.js"
const ListInfo = () => {
  return (
    <div className="float-bloc-list">
    <div className="greet" >
        <div className="title">Liste des plantes de la categorie</div>
        <div className="subtitle">Cliquez sur le X pour supprimer de la categorie!</div>
    </div>

        <br></br>
        <div className="list-info">
        <div className="plant-image">
            <img src="/assets/plant.jpg" alt="Plant" />
        </div>
        <div className="plant-name" style={{ width: '100%' }}>Nom de la plante</div>

        <Deletebutton/>
        </div>

    </div>
  );
};

export default ListInfo;
